import styled from 'styled-components';
import {PageWrap} from '../../components/common/styled'
import Header from '../../components/common/header'
import {useState} from 'react'

const Exploring = () => {

  const onClick = () => {
    setToggle(!toggle);
    console.log(toggle);
    toggle ? dropBtn.style.display='flex' : dropBtn.style.display='none';
  }
  return (
    <PageWrap>
      <Header />
      <CompanyListBox>
        <CompanyListCenter>
          <CompanyFilterBox>
            <FilterLiftBox>
              <TagFilterBtn><BtnTitle>태그</BtnTitle><TagText>딱 맞는 기업 찾기</TagText><ArrIcon /></TagFilterBtn>
              <FilterBtn><BtnTitle>지역</BtnTitle><FilterText>서울 외</FilterText><ArrIcon /></FilterBtn>
              <FilterBtn><BtnTitle>경력</BtnTitle><FilterText>신입</FilterText><ArrIcon /></FilterBtn>
            </FilterLiftBox>
            <FilterRightBox>
              <DropdownBtnBox>
                <DropdownBtn onClick={onClick}>최신순<ArrIcon /></DropdownBtn>
                <DropdownListUl id='dropList'>
                  <DropdownListLi >응답률순</DropdownListLi>
                  <DropdownListLi>보상금순</DropdownListLi>
                  <DropdownListLi>인기순</DropdownListLi>
                </DropdownListUl>
              </DropdownBtnBox>
            </FilterRightBox>
          </CompanyFilterBox>
        </CompanyListCenter>
      </CompanyListBox>
    </PageWrap>
  )
  const dropBtn = document.getElementById('dropList');
  const [toggle, setToggle] = useState(false);

}

const CompanyListBox = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`
const CompanyListCenter = styled.div`
  max-width: 1060px;
  width: 100%;
  display: flex;
  flex-direction: column;
  padding: 20px 0 80px;
`
const CompanyFilterBox = styled.div`
  top: 50px;
  margin-bottom: 19px;
  padding-top: 10px;
`
const FilterLiftBox = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: left;
  align-items: center;
`
const FilterRightBox = styled.div`
  height: 40px;
`
const TagFilterBtn = styled.button`
  -webkit-box-align: center;
  align-items: center;
  display: inline-flex;
  height: 40px;
  padding: 0 39px 0 15px;
  margin-bottom: 0;
  border-radius: 5px;
  border: 1px solid #ececec;
  position: relative;
`
const FilterBtn = styled.button`
  -webkit-box-align: center;
  align-items: center;
  display: inline-flex;
  height: 40px;
  padding: 0 39px 0 15px;
  margin-bottom: 0;
  border-radius: 5px;
  border: 1px solid #ececec;
  position: relative;
  margin-left: 10px;
`
const ArrIcon = styled.span`
  content: "";
  top: 50%;
  right: 16px;
  width: 0;
  height: 0;
  position: absolute;
  z-index: 99;
  border-top: 6px solid #333;
  border-left: 4px solid transparent;
  border-right: 4px solid transparent;
  -webkit-transform: translateY(-50%);
  transform: translateY(-50%);
`
const BtnTitle = styled.div`
  font-size: 14px;
  font-weight: 400;
  letter-spacing: normal;
  color: #333;
  margin-right: 8px;
  white-space: nowrap;
`
const TagText = styled.span`
  color: #999;
  font-weight: 400;
  font-size: 14px;
`
const FilterText = styled.span`
  color: #36f;
  font-weight: 600;
  margin-right: 0;
  overflow: hidden;
  text-overflow: ellipsis;
  font-size: 14px;
`
const DropdownBtnBox = styled.div`
  width: 104px;
`
const DropdownBtn = styled.button`
  border: 1px solid #ececec;
  background-color: #fff;
  font-size: 14px;
  font-weight: 400;
  height: 40px;
  letter-spacing: normal;
  color: #000;
  padding: 0 0 0 16px;
  position: relative;
  width: 100%;
  text-align: left;
  border-radius: 4px 4px 0 0;
  cursor: pointer;
`
const DropdownListUl = styled.ul`
  flex-direction: column;
  justify-content: center;
  align-items: center;
  background: #fff;
  border: 1px solid #ececec;
  border-radius: 0 0 4px 4px;
  display: none;
`
const DropdownListLi = styled.li`

  width: 100%;
  font-size: 14px;
  font-weight: 400;
  font-stretch: normal;
  font-style: normal;
  line-height: 40px;
  letter-spacing: normal;
  color: #333;
  text-align: left;
  padding: 0 0 0 16px;
  border-bottom: 1px solid #ececec;

`
export default Exploring;
